script: |
  super -f text -I q11642.spq | sort > q11642.out

inputs:
  - name: q11642.spq
    data: |
      SELECT DISTINCT - MAX ( - 70 ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q11642.out
    data: |
      70
